import React from 'react';
import './Header.css';
import { Link } from 'react-router-dom';
import logo from '../../images/logo.svg';
//import logoDark from '../../images/logo-dark.svg';

function Header() {
    return (
        <header className="header">
            <Link className="header__logo" src={logo} alt="Логотип" to="/" />
            <ul className="header__nav">
                <li className="header__nav-item header__nav-item_active">
                    <a className="header__nav-link" href="http://localhost:3000/">Главная</a>
                </li>
                <li className="header__nav-item">
                    <button className="header__nav-btn">Авторизоваться</button>
                </li>
            </ul>
        </header>
    )
}

export default Header;
